import React from 'react';
import logo from './logo.svg';
import './App.css';
import prodlist from './products';

function Products() {
  return (
    <div>
    {prodlist.map((item => {
      return(
      <div>
        <h2>{item.title}</h2>
        <img src={item.image} alt={item.alt}/>
        <p>{item.price}</p>
        <p>{item.description}</p>
      </div>)
    }))}
    </div>
  );
}

export default Products;
